http://www.native-instruments.com/#/en/products/producer/maschine/?page=2164&lt;/a&gt;

Instructions:

Copy all the content from the library folder on the disk to
your HD/Library/Application Support/Native Instruments/Maschine/Maschine Library.
Let it replace the folders which are already there and you are done.
